widgets.props:
JS{{
var props = {}
var labels = ["Clear", "Update"]
props.mode = "push"
props.label = labels[$]
props.target = @{variable_midiport}
props.on = 127
props.off = 0
props.address =  "/control"
props.preArgs = [@{variable_midichannel}, $+1+@{parent.variables.n}]
return props
}}

widgets.value:
JS{{
var val = @{switch_notezero_@{parent.variables.n}} + @{switch_octavezero_@{parent.variables.n}} * 12
return Math.min(127, Math.max(0, val))
}}

